import re
from bs4 import BeautifulSoup

class Engagement(object):
    def __init__(self, name, id, account, opty_status, type, queue, eng_status, top_opty, initiator, my_role, resources, hours, service_count, age, url):
        self.name = name
        self.id = id
        self.account = account
        self.opty_status = opty_status
        self.type = type
        self.queue = queue
        self.eng_status = eng_status
        self.top_opty = top_opty
        self.initiator = initiator
        self.my_role = my_role
        self.resources = resources
        self.hours = hours
        self.service_count = service_count
        self.age = age
        self.url = url
    
    def __str__(self):
        return (self.id + ": "+ self.name)
        

class Parser(object):
    '''
    classdocs
    '''


    def __init__(self, html):
        '''
        Constructor
        '''
        self.html = html
        self.soup = BeautifulSoup(self.html, "html.parser")
        self.engagements = []
        
    def processEngagements(self):
        table = self.soup.find('table', attrs={'class':'table table-condensed'})
        body = table.find('tbody')
        rows = body.find_all('tr')
        for row in rows:
            anEngagement = self.processEngagement(row)
            self.engagements.append(anEngagement)
   
    def processUrl(self, url):
        p = re.compile("\w*:\w*:\w*:::\w*:\w*,\w*,\w*,\w*,\w*:(\w*),SUMMARY,,,")
        g = p.search(url)
        if g:
            id = g.groups()[0]
            return id

    def processEngagement(self, row):
        cols = row.find_all('td')
        for counter, col in enumerate(cols):
            header = col.attrs['headers'][0]
            if header == "ENG_ID":
                a = col.a
                url=a.attrs['href']
                #id = self.processUrl(url)
            elif header == "ENG_NAME":
                name = col.string
            elif header == "ENG_ID2":
                id = col.string
            elif header == "ACCOUNT":
                account = col.string
            elif header == "OPTY_STATUS":
                opty_status = col.string
            elif header == "TYPE_NAME":
                type = col.string
            elif header == "QUEUE_NAME":
                queue = col.string
            elif header == "STATUS":
                eng_status = col.string
            elif header == "TOP_OPTY":
                top_opty = col.string
            elif header == "INITIATOR":
                initiator = col.string
            elif header == "MY_ROLE":
                my_role = col.string
            elif header == "RESOURCE_COUNT":
                a = col.a
                resources=a.attrs['title']
                people = (resources.split("</b>")[1:])
                res = {}
                for person in people:
                    p = (person.split("<br>"))
                    if p:
                        name, role = (p[0].split(" - "))
                        res[name] = role
            elif header == "HOURS":
                hours = col.string
            elif header == "SERVICE_COUNT":
                service_count = col.string
            elif header == "REQUEST_AGE":
                age = col.string
            
        mye = Engagement(name, id, account, opty_status, type, queue, eng_status, top_opty, initiator, my_role, resources, hours, service_count, age, url)
        return mye


            
